- input: "TEXT\x1CC00396671\x1C.TEXT\x1C\x1CF3XA\x1CIn reviewing our financial records,
    it was discovered that a corporate check, which should have been deposited into
    the connected organizations's administrative account (for PAC expenses), was mistakenly
    deposited into the Hardwood Federation PAC account in November.  Immediately,
    upon discovery of this error, the $4,000 contribution from Glen Oak Lumber was
    transferred out of the Hardwood Federation PAC account on January 7.  This refund
    transaction will be reflected in our February monthly report which covers the
    month of January.  We apologize for this error, and thus, have put into place
    better controls to prevent this from happening in the future."
